import { useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/login");
  };

  return (
    <nav className="navbar">
      {/* existing nav items */}
      <button onClick={handleLogout} className="logout-button">Logout</button>
    </nav>
  );
};
